"use strict";(globalThis.webpackChunktextbook_docusaurus=globalThis.webpackChunktextbook_docusaurus||[]).push([[2556],{1864:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","href":"/aiproject1/docs/intro","label":"Introduction","docId":"intro","unlisted":false},{"type":"category","label":"Chapters","items":[{"type":"link","href":"/aiproject1/docs/chapters/introduction/","label":"Chapter 1: Introduction to Physical AI","docId":"chapters/introduction/index","unlisted":false},{"type":"link","href":"/aiproject1/docs/chapters/mathematical-foundations/","label":"Chapter 2: Mathematical Foundations of Physical AI and Humanoid Robotics","docId":"chapters/mathematical-foundations/index","unlisted":false},{"type":"link","href":"/aiproject1/docs/chapters/robot-kinematics-dynamics/","label":"Chapter 3: Robot Kinematics and Dynamics","docId":"chapters/robot-kinematics-dynamics/index","unlisted":false},{"type":"link","href":"/aiproject1/docs/chapters/sensor-systems-perception/","label":"Chapter 4: Sensor Systems and Perception","docId":"chapters/sensor-systems-perception/index","unlisted":false},{"type":"link","href":"/aiproject1/docs/chapters/motion-planning-control/","label":"Chapter 5: Motion Planning and Control","docId":"chapters/motion-planning-control/index","unlisted":false},{"type":"link","href":"/aiproject1/docs/chapters/ai-algorithms-embodiment/","label":"Chapter 6: AI Algorithms for Embodiment","docId":"chapters/ai-algorithms-embodiment/index","unlisted":false},{"type":"link","href":"/aiproject1/docs/chapters/humanoid-robotics-platforms/","label":"Chapter 7: Humanoid Robotics Platforms","docId":"chapters/humanoid-robotics-platforms/index","unlisted":false},{"type":"link","href":"/aiproject1/docs/chapters/safety-ethics-societal-impact/","label":"Chapter 8: Safety, Ethics, and Societal Impact","docId":"chapters/safety-ethics-societal-impact/index","unlisted":false},{"type":"link","href":"/aiproject1/docs/chapters/case-studies-applications/","label":"Chapter 9: Case Studies and Applications","docId":"chapters/case-studies-applications/index","unlisted":false},{"type":"link","href":"/aiproject1/docs/chapters/future-research-directions/","label":"Chapter 10: Future Research Directions","docId":"chapters/future-research-directions/index","unlisted":false}],"collapsed":true,"collapsible":true},{"type":"category","label":"Tutorial Basics","items":[{"type":"link","href":"/aiproject1/docs/tutorial-basics/create-a-document","label":"Create a Document","docId":"tutorial-basics/create-a-document","unlisted":false},{"type":"link","href":"/aiproject1/docs/tutorial-basics/create-a-blog-post","label":"Create a Blog Post","docId":"tutorial-basics/create-a-blog-post","unlisted":false},{"type":"link","href":"/aiproject1/docs/tutorial-basics/create-a-page","label":"Create a Page","docId":"tutorial-basics/create-a-page","unlisted":false},{"type":"link","href":"/aiproject1/docs/tutorial-basics/markdown-features","label":"Markdown Features","docId":"tutorial-basics/markdown-features","unlisted":false},{"type":"link","href":"/aiproject1/docs/tutorial-basics/deploy-your-site","label":"Deploy your site","docId":"tutorial-basics/deploy-your-site","unlisted":false},{"type":"link","href":"/aiproject1/docs/tutorial-basics/congratulations","label":"Congratulations!","docId":"tutorial-basics/congratulations","unlisted":false}],"collapsed":true,"collapsible":true},{"type":"category","label":"Tutorial Extras","items":[{"type":"link","href":"/aiproject1/docs/tutorial-extras/manage-docs-versions","label":"Manage Docs Versions","docId":"tutorial-extras/manage-docs-versions","unlisted":false},{"type":"link","href":"/aiproject1/docs/tutorial-extras/translate-your-site","label":"Translate your site","docId":"tutorial-extras/translate-your-site","unlisted":false}],"collapsed":true,"collapsible":true}]},"docs":{"chapters/ai-algorithms-embodiment/index":{"id":"chapters/ai-algorithms-embodiment/index","title":"Chapter 6: AI Algorithms for Embodiment","description":"Embodied AI focuses on developing intelligent agents that can learn, reason, and act within a physical body in the real world. This chapter explores various AI algorithms, particularly those from machine learning, that are specifically adapted or designed for the unique challenges and opportunities presented by physical embodiment in robots and other intelligent systems.","sidebar":"tutorialSidebar"},"chapters/case-studies-applications/index":{"id":"chapters/case-studies-applications/index","title":"Chapter 9: Case Studies and Applications","description":"Physical AI and humanoid robotics are rapidly moving from research labs to real-world applications, transforming industries and impacting daily life. This chapter presents a series of case studies, illustrating how the theoretical concepts and algorithms discussed in previous chapters are applied in practice across various domains. It highlights successful deployments, innovative solutions, and the challenges faced in bringing these technologies to fruition.","sidebar":"tutorialSidebar"},"chapters/future-research-directions/index":{"id":"chapters/future-research-directions/index","title":"Chapter 10: Future Research Directions","description":"The field of physical AI and humanoid robotics is dynamic and rapidly evolving, with numerous exciting challenges and opportunities for future research. This chapter outlines some of the key open problems, emerging trends, and interdisciplinary areas that will shape the next generation of intelligent physical systems. It serves as an invitation to students and researchers to contribute to this transformative domain.","sidebar":"tutorialSidebar"},"chapters/humanoid-robotics-platforms/index":{"id":"chapters/humanoid-robotics-platforms/index","title":"Chapter 7: Humanoid Robotics Platforms","description":"Humanoid robotics platforms are the physical embodiment of advanced AI algorithms, designed to operate in environments built for humans and to interact with them intuitively. This chapter provides an overview of the design considerations, hardware components, and notable examples of humanoid robots, highlighting the engineering challenges and innovative solutions in their development.","sidebar":"tutorialSidebar"},"chapters/introduction/index":{"id":"chapters/introduction/index","title":"Chapter 1: Introduction to Physical AI","description":"Physical AI is an emerging field that focuses on the integration of artificial intelligence with physical systems, enabling machines to perceive, reason, and act in the real world. Unlike traditional AI, which primarily operates in virtual environments, Physical AI deals with the complexities and uncertainties of physical interaction, embodiment, and real-time sensory data.","sidebar":"tutorialSidebar"},"chapters/mathematical-foundations/index":{"id":"chapters/mathematical-foundations/index","title":"Chapter 2: Mathematical Foundations of Physical AI and Humanoid Robotics","description":"To build intelligent physical systems, a strong grasp of mathematical principles is essential. This chapter lays the groundwork by introducing key concepts from linear algebra, calculus, and probability theory, which are fundamental to understanding kinematics, dynamics, control, and learning in Physical AI and Humanoid Robotics.","sidebar":"tutorialSidebar"},"chapters/motion-planning-control/index":{"id":"chapters/motion-planning-control/index","title":"Chapter 5: Motion Planning and Control","description":"Motion planning and control are central to enabling physical AI and humanoid robots to execute tasks autonomously and safely in complex environments. This chapter covers the algorithms and methodologies used to generate collision-free paths for robots and to ensure that robots accurately follow these planned motions, even in the presence of disturbances.","sidebar":"tutorialSidebar"},"chapters/robot-kinematics-dynamics/index":{"id":"chapters/robot-kinematics-dynamics/index","title":"Chapter 3: Robot Kinematics and Dynamics","description":"Robot kinematics and dynamics are fundamental concepts in robotics, crucial for understanding how a robot moves, how its joints relate to its end-effector position, and how forces and torques influence its motion. This chapter will delve into both forward and inverse kinematics, as well as the basics of robot dynamics.","sidebar":"tutorialSidebar"},"chapters/safety-ethics-societal-impact/index":{"id":"chapters/safety-ethics-societal-impact/index","title":"Chapter 8: Safety, Ethics, and Societal Impact","description":"The increasing sophistication of physical AI and humanoid robots brings forth critical considerations regarding safety, ethics, and their broader societal impact. As these intelligent systems become more integrated into our daily lives, it is imperative to address potential risks, establish ethical guidelines, and understand the profound changes they will bring to work, privacy, and human interaction. This chapter explores these multifaceted challenges and discusses approaches to responsible development.","sidebar":"tutorialSidebar"},"chapters/sensor-systems-perception/index":{"id":"chapters/sensor-systems-perception/index","title":"Chapter 4: Sensor Systems and Perception","description":"For physical AI and humanoid robots to interact intelligently with the real world, they must first be able to perceive it. This chapter explores the various sensor systems used in robotics and the computational techniques for processing sensor data to build a coherent understanding of the environment. Perception is the bridge between the physical world and the robot\'s internal cognitive processes.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Introduction","description":"Welcome to the Docusaurus Textbook on Physical AI & Humanoid Robotics! This textbook aims to provide a comprehensive overview of the fascinating and rapidly evolving fields of physical artificial intelligence and humanoid robotics.","sidebar":"tutorialSidebar"},"tutorial-basics/congratulations":{"id":"tutorial-basics/congratulations","title":"Congratulations!","description":"You have just learned the basics of Docusaurus and made some changes to the initial template.","sidebar":"tutorialSidebar"},"tutorial-basics/create-a-blog-post":{"id":"tutorial-basics/create-a-blog-post","title":"Create a Blog Post","description":"Docusaurus creates a page for each blog post, but also a blog index page, a tag system, an RSS feed...","sidebar":"tutorialSidebar"},"tutorial-basics/create-a-document":{"id":"tutorial-basics/create-a-document","title":"Create a Document","description":"Documents are groups of pages connected through:","sidebar":"tutorialSidebar"},"tutorial-basics/create-a-page":{"id":"tutorial-basics/create-a-page","title":"Create a Page","description":"Add Markdown or React files to src/pages to create a standalone page:","sidebar":"tutorialSidebar"},"tutorial-basics/deploy-your-site":{"id":"tutorial-basics/deploy-your-site","title":"Deploy your site","description":"Docusaurus is a static-site-generator (also called Jamstack).","sidebar":"tutorialSidebar"},"tutorial-basics/markdown-features":{"id":"tutorial-basics/markdown-features","title":"Markdown Features","description":"Docusaurus supports Markdown and a few additional features.","sidebar":"tutorialSidebar"},"tutorial-extras/manage-docs-versions":{"id":"tutorial-extras/manage-docs-versions","title":"Manage Docs Versions","description":"Docusaurus can manage multiple versions of your docs.","sidebar":"tutorialSidebar"},"tutorial-extras/translate-your-site":{"id":"tutorial-extras/translate-your-site","title":"Translate your site","description":"Let\'s translate docs/intro.md to French.","sidebar":"tutorialSidebar"}}}}')}}]);